INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, "春咲 ひより", 1, 1, 0, 0, 0, "お！\nあそこに困ってそうな人発見！", 1001, 0, 1.4, 2, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("みんなみたいに\nわたしも強くならなきゃ", 1, "草野 優衣", 1, 1, 0, 0, 0, "大切な人を\n守れるようになりたい…って", 1002, 0, 1.4, 2, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("フェンシングを始めてみては？", 1, "士条 怜", 1, 1, 0, 0, 0, "キミに必要な集中力と感性が", 1003, 0, 1.4, 2, 0, "少しは磨かれると思いますよ。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ねぇ、にいちゃん！", 1, "穂高 みそぎ", 1, 1, 0, 0, 0, "今日はなにして遊ぶ？", 1004, 0, 1.5, 2, 0, "みそぎはねぇ、\nかくれんぼやりたい！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("風宮あかりです", 1, "風宮 あかり", 1, 1, 0, 0, 0, "ねぇ…", 1006, 0, 1.4, 2, 0, "私といっしょに…\nいかない？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("出雲宮子なのー", 1, "出雲 宮子", 1, 1, 0, 0, 0, "プリンたべたいのー", 1007, 0, 1.5, 2, 0, "食べ物の恨みは怖いのー");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ボクは虹村雪。", 1, "虹村 雪", 1, 1, 0, 0, 0, "キミもボクの美貌に\n吸い寄せられたんだね。", 1008, 0, 1.4, 2, 0, "いいよ。\n見られることは運命さ…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("フッ…聞いて後悔するがいい！", 1, "柊杏奈", 1, 1, 0, 0, 0, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", 1009, 0, 1.4, 2, 0, "人呼んで「疾風の冥姫」!!");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("マホマホ王国のプリンセス、\nまほ姫どす", 1, "姫宮 真歩", 1, 1, 0, 0, 0, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", 1010, 0, 1.5, 2, 0, "ほんまおおきにやわ～♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("衣之咲璃乃です！", 1, "衣之咲 璃乃", 1, 1, 0, 0, 0, "生き別れたお兄ちゃんを探して\n三千世界！", 1011, 0, 1.4, 2, 0, "ここで会ったが\n100年目～！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, "柏崎 初音", 1, 1, 0, 0, 0, "ち、超能力って…\n何のことかな～？", 1012, 0, 1.4, 2, 0, "…って、お願い！\n誰にも言わないでおいて～！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ちょす！\n美波鈴奈だよ～♪", 1, "美波 鈴奈", 1, 1, 0, 0, 0, "一応カリスマ読モJKやってまっす！", 1016, 0, 1.4, 2, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("はいたーい。\n喜屋武香織さー。", 1, "喜屋武 香織", 1, 1, 0, 0, 0, "東京は遊園地みたいなところさー", 1017, 0, 1.4, 2, 0, "でも、沖縄もとってもいいとこさー");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("支倉伊緒です。", 1, "支倉 伊緒", 1, 1, 0, 0, 0, "先生って呼ばれるのは\nくすぐったいから", 1018, 0, 1.4, 2, 0, "イオちゃんって呼んでね。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, "茜 ミミ", 1, 1, 0, 0, 0, "あ！/\お兄ちゃ～ん\nまってよ～", 1020, 0, 1.5, 2, 0, "ミミをおいてかないでぇ～");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("あ…あの…えっと…\n栗…林…くるみ…です……", 1, "栗林 くるみ", 1, 1, 0, 0, 0, "あの……\nふぇ……", 1021, 0, 1.5, 2, 0, "ふぇぇぇぇぇん……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("風宮よりです。\nあああああ！", 1, "風宮 より", 1, 1, 0, 0, 0, "こんな私に貴重な時間を\n割いていただき、", 1022, 0, 1.4, 2, 0, "なんてありがとうございます！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, "北条 綾音", 1, 1, 0, 0, 0, "おにいちゃんどこいくの？\nえ？", 1023, 0, 1.5, 2, 0, "私こっち行きたいー\nね、早く早くー");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("わっ…わっ…私、\n天野すずめといいます！", 1, "天野 すずめ", 1, 1, 0, 0, 0, "ふ、不束者ですが\nどうぞ末永く…って、", 1025, 0, 1.4, 2, 0, "これて何か違う…\nあああすみません！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("……クスクス…私は\n…倉石恵理子……", 1, "倉石 恵理子", 1, 1, 0, 0, 0, "あなたは…運命の……\n伴侶……", 1027, 0, 1.4, 2, 0, "離しませんわ………\n絶対に…!!");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, "佐々木 咲恋", 1, 1, 0, 0, 0, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", 1028, 0, 1.4, 2, 0, "…そうでしょ？？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("桜井望だよ！\nよろしくねっ", 1, "桜井 望", 1, 1, 0, 0, 0, "ぇっと…\nキミ、私のこと知らないの?!", 1029, 0, 1.4, 2, 0, "あはは、\n私もまだまだだなぁ～");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("デケデケデンっ！", 1, "ニノン・ジュベール", 1, 1, 0, 0, 0, "初めまして、\n私はニノン・ジュベール申すデス！", 1030, 0, 1.4, 2, 0, "ショーグン、\nワタシと一緒に天下統一デース！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("上喜しのぶです。\n手元のドクロが父です。", 1, "上喜 しのぶ", 1, 1, 0, 0, 0, "でもって私の隣にいるのが……\nえ、見えない？", 1031, 0, 1.4, 2, 0, "おかしいですね……");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("目指すはビッグな\nお笑い芸人だっぺ！", 1, "野戸まひる", 1, 1, 0, 0, 0, "けんども\nそれには足りないモンが…", 1033, 0, 1.5, 2, 0, "そう、\nオラのボケに突っ込める相方が…！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, "綾瀬 ゆかり", 1, 1, 0, 0, 0, "ちょっと緊張しちゃって…", 1034, 0, 1.4, 2, 0, "ちょ\nちょっと一杯飲んできます…！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("氷川鏡華…です", 1, "氷川 鏡華", 1, 1, 0, 0, 0, "知らない人とは話しちゃいけないので", 1036, 0, 1.5, 2, 0, "これ以上お話しすることは…\nないです！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("柏崎…栞です。", 1, "柏崎 栞", 1, 1, 0, 0, 0, "……あ、アラーム。", 1038, 0, 1.4, 2, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("ふ、双葉碧です。", 1, "双葉 碧", 1, 1, 0, 0, 0, "私、一人も友達がいなくて……", 1040, 0, 1.4, 2, 0, "野に咲く花が、\n唯一の話相手です。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("三角千歌です。", 1, "三角 千歌", 1, 1, 0, 0, 0, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", 1042, 0, 1.4, 2, 0, "そう思っています。");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("安芸真琴だ。", 1, "安芸 真琴", 1, 1, 0, 0, 0, "あぁ？\nお前のそいつの仲間か？", 1043, 0, 1.4, 2, 0, "う、疑ってすまなかったな…");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("わらわこそは夜を総べる者！", 1, "イリヤ・オーンスタイン", 1, 1, 0, 0, 0, "生けとし生ける全ての者よ！", 1044, 0, 1.4, 2, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("そこで騎士は妖精を乱暴に……", 1, "遠見 空花", 1, 1, 0, 0, 0, "ぐふふふふ……はっ！", 1045, 0, 1.4, 2, 0, "ｌク、クウカに何かご用ですか!?");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, "宮坂たまき", 1, 1, 0, 0, 0, "自由気ままで♪\n寝て遊んで、食べてケンカして…", 1046, 0, 1.4, 2, 0, "う～ん…\n猫ってホントに最高にゃ～♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("大神美冬よ！", 1, "大神 美冬", 1, 1, 0, 0, 0, "それでは早速クエストに…", 1048, 0, 1.4, 2, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("星野静流だよ！", 1, "星野静流", 1, 1, 0, 0, 0, "クエストもバトルも\n掃除も洗濯も", 1049, 0, 1.4, 2, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("アタシは玉泉美咲。", 1, "玉泉美咲", 1, 1, 0, 0, 0, "見ての通りの\nセクシー美少女で", 1050, 0, 1.5, 2, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("？？？", 1, "リマ", 1, 1, 0, 0, 0, "？？？？", 1052, 0, 1.4, 2, 0, "？？？？");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("モニカ・ヴァイスヴィントだ。", 1, "モニカ・ヴァイスヴィント", 1, 1, 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1053, 0, 1.5, 2, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("モニカ・ヴァイスヴィントだ。", 1, "ペコリーヌ", 1, 1, 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1058, 0, 1.5, 2, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("モニカ・ヴァイスヴィントだ。", 1, "コッコロ", 1, 1, 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1059, 0, 1.5, 2, 0, "そ、そこまでいうなら\nもらってやる");
INSERT INTO `v1_cec43a03c5802a94c628383d03774278f12b0113d9e6066983b42262a96d2cfb` VALUES ("モニカ・ヴァイスヴィントだ。", 1, "キャル", 1, 1, 0, 0, 0, "菓子でつろうなどと\n稚拙な策を……", 1060, 0, 1.5, 2, 0, "そ、そこまでいうなら\nもらってやる");
